import React from 'react';

import './info.scss'
 
const Info = () => {
    return (
        <div className="Info">
            <h2 className="Info_title">Hello, i'm Mukhammad</h2>
        </div>
    );
}
 
Info.propTypes = {};
 
export default Info;
